CREATE TRIGGER  [LTMS].[Bookings_UpdateTrigger] on [LTMS].[Bookings] FOR UPDATE
AS
BEGIN
	UPDATE B SET [RowModified] = GETDATE() 
	FROM [LTMS].[Bookings] B 
	INNER JOIN inserted I ON B.ID = I.ID
END
GO

